import React from "react";
import SocialItem from "./SociaItem";
function Social(){
    return(
    <ul className='list-group'>
        <SocialItem
         media = 'FaceBook'
         id='facebook'
         img="https://picsum.photos/200"
         />
        <SocialItem 
         media = 'Instagram'
         id='instagram'
         img="https://picsum.photos/200"
         />
        <SocialItem
         media = 'Youtube'
         id='youtube'

         />
    </ul>

    );
}
export default Social;
